import React from "react";
import { Router } from "react-router-dom";
import history from "../utils/history";

import NavigationBar from "./NavigationBar";

function App() {
  return (
    <>
      <Router history={history}>
        <header>
          <NavigationBar />
        </header>
      </Router>
    </>
  );
}

export default App;
